# MOD = 10**9 + 7


class Solution:
    def minCost(self, nums: List[int], cost: List[int]) -> int:
        def checkCost(x):
            tmp_cost = 0
            for i, num in enumerate(nums):
                tmp_cost += abs(x - num) * cost[i]
            return tmp_cost

        low = 0
        high = 10**6
        cnt = 0
        while cnt < 40:
            c1 = (low * 2 + high) / 3
            c2 = (low + high * 2) / 3
            if checkCost(c2) < checkCost(c1):
                low = c1
            else:
                high = c2
            cnt += 1

        return min([checkCost(int(high) + i) for i in range(10)])


